import React from 'react';
import { Map, TileLayer, GeoJSON } from 'react-leaflet';
import L from 'leaflet';
import './leaflet.css';

import places2017 from './data/places_2016.js';
import places2018 from './data/places_2017.js';
import places2019 from './data/places_2018.js';

const styles = {
  wrapper: {
    height: 400,
    width: '80%',
    margin: '0 auto',
    display: 'flex'
  },
  map: {
    flex: 1
  }
};

const geojsonMarkerOptions2017 = {
  radius: 4,
  fillColor: "#EE4266",
  color: "#000",
  weight: 0,
  opacity: 1,
  fillOpacity: 0.4
};

function pointToLayer2017(feature, latlng) {
  return L.circleMarker(latlng, geojsonMarkerOptions2017);
}

const geojsonMarkerOptions2018 = {
  radius: 4,
  fillColor: "#6E3BFB",
  color: "#000",
  weight: 0,
  opacity: 1,
  fillOpacity: 0.4
};

function pointToLayer2018(feature, latlng) {
  return L.circleMarker(latlng, geojsonMarkerOptions2018);
}

const geojsonMarkerOptions2019 = {
  radius: 4,
  fillColor: "#3DF6CF",
  color: "#000",
  weight: 0,
  opacity: 1,
  fillOpacity: 0.4
};

function pointToLayer2019(feature, latlng) {
  return L.circleMarker(latlng, geojsonMarkerOptions2019);
}

const Moves = props => {
  return (
    <div style={styles.wrapper}>
      <Map style={styles.map} center={props.center} zoom={props.zoom}>
        <TileLayer url={props.url} />
        <GeoJSON
          data={places2017}
          pointToLayer={pointToLayer2017}
        />
        <GeoJSON
          data={places2018}
          pointToLayer={pointToLayer2018}
        />
        <GeoJSON
          data={places2019}
          pointToLayer={pointToLayer2019}
        />
      </Map>
    </div>
  );
}

Moves.defaultProps = {
  center: [27.9361805667694, -15.589599609374998],
  zoom: 10,
  url: 'https://stamen-tiles-{s}.a.ssl.fastly.net/toner/{z}/{x}/{y}{r}.png'
};

export default Moves;
